import React from "react";
import {Title} from './title';
import {VantaggiNoleggio} from './vantaggi_noleggio';
import styled, { css } from 'styled-components';
const RedRectangle = styled.div`
    position: absolute;
    top: 0;
    left: -400px;
    background: #8D120C;
    width: 1500px;
    height: 546px;
    z-index: 0;
`;
const Container = styled.div`
    font-family: Calibri, Candara, Segoe, "Segoe UI", Optima, Arial, sans-serif;
    @media only all and (max-width: 1440px) {
        max-width: 100%!important;
        flex: 0 0 100%!important;
    }
`;
const TitleRinoleggo = styled.div`
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 900;
    font-size: 60px;
    letter-spacing: 0.05em;
    text-decoration-line: underline;
    text-transform: uppercase;
    color: #1D1D1B;
`;
function Ri_noleggio() {
    return(
        <>
        <Title/>
        <Container className="col-sm-8 mx-auto text-center row">
        <RedRectangle>
        </RedRectangle>
        <div>
            <TitleRinoleggo>RINOLEGGIO</TitleRinoleggo>
        </div>
        </Container>
        <VantaggiNoleggio/>
        </>
    );
}
export {Ri_noleggio};
